      SELECT DISTINCT col2 * - 16 + + CAST ( 81 AS INTEGER ) FROM tab2 WHERE NOT ( 12 / - CAST ( - 64 / - col2 AS REAL ) + col1 ) NOT BETWEEN - col1 AND + col1 * + col0 + col0 * + col0;
  - name: tab2

outputs:
  - name: q5402.out
    data: |
      -287
      -559
      -847
